vncviewer.excerpt:
VncViewer lets you monitor or operate GUI of your running build. You can start HTML5 based VNC viewer via HTML link directly from 'Console output'.&nbsp;This plugin can be used in combination with&nbsp;
<a rel="nofollow">Xvnc</a>&nbsp;and&nbsp;
<a rel="nofollow">VncRecorder</a> plugins.

semantic-versioning-plugin.excerpt:
{color:#333333}The SemanticVersioning plugin for&nbsp;{color}
<a href="http://jenkins-ci.org/" rel="nofollow">Jenkins</a>{color:#333333}&nbsp;is a plugin that reads the base version (Major, Minor, SNAPSHOT) settings from various build definition file formats. The plugin currently supports POM, SBT, and Build.scala. SemanticVersioning uses the values parsed from the build definition files in conjunction with the&nbsp;{color}
<a href="http://jenkins-ci.org/" rel="nofollow">Jenkins</a>{color:#333333}&nbsp;build number to create a&nbsp;{color}
<a href="http://semver.org" rel="nofollow">Semantic Versioning</a>{color:#333333}&nbsp;string. The string is stored in an build-environment variable (name is configurable). Additionally the{color} 
<a href="http://semver.org" rel="nofollow">Semantic Versioning</a>{color:#333333}&nbsp;string is written to a file in the Artifact directory.{color} {color:#333333}The second part of the plugin adds a column to the Dashboard that displays the&nbsp;{color}
<a href="http://semver.org" rel="nofollow">Semantic Versioning</a>{color:#333333}&nbsp;string from the most recent successful build.{color}
